As in every Perseus app, lib.rs is how we communicate with the CLI and tell it how our app works. Put the following content in src/lib.rs: mod error_pages;
mod templates; use perseus::define_app; define_app! { templates: [ crate::templates::index::get_template::<G>(), crate::templates::about::get_template::<G>() ], error_pages: crate::error_pages::get_error_pages(), static_aliases: { "/test.txt" => "static/test.txt" }
} This code is quite different from your first app, so let's go through how it works. First, we define two other modules in our code: error_pages (at src/error_pages.rs) and templates (at src/templates). Don't worry, we'll create those in a moment. The rest of the code creates a new app with two templates, which are expected to be in the src/templates directory. Note the use of <G> here, which is a Rust type parameter (the get_template function can work for the browser or the server, so Rust needs to know which one it is). This parameter is ambient to the templates key, which means you can use it without declaring it as long as you're inside templates: {...}. This will be set to DomNode for the browser and SsrNode for the server, but that all happens behind the scenes. Also note that we're pulling in our error pages from another file as well (in a larger app you may even want to have a different file for each error page). The last thing we do is new, we define static_aliases to map the URL /test.txt in our app to the file static/test.txt. This feature is detailed in more depth later, but it can be extremely useful, for example for defining your site's logo (or favicon), which browsers expect to be available at /favicon.ico. Create the static/test.txt file now (static/ should NOT be inside src/!) and fill it with whatever you want.

