Before we get to the cool part of building the actual pages of the app, we should set up error pages again, which we'll do in src/error_pages.rs: use perseus::{ErrorPages, GenericNode};
use std::rc::Rc;
use sycamore::template; pub fn get_error_pages<G: GenericNode>() -> ErrorPages<G> { let mut error_pages = ErrorPages::new(Rc::new(|url, status, err, _| { template! { p { (format!("An error with HTTP code {} occurred at '{}': '{}'.", status, url, err)) } } })); error_pages.add_page( 404, Rc::new(|_, _, _, _| { template! { p { "Page not found." } } }), ); error_pages
} This is a little more advanced than the last time we did this, and there are a few things we should note. The first is the import of GenericNode, which we define as a type parameter on the get_error_pages function. As we said before, this means your error pages will work on the client or the server, and they're needed in both environments. If you're interested, this separation of browser and server elements is done by Sycamore, and you can learn more about it here . In this function, we also define a different error page for a 404 error, which will occur when a user tries to go to a page that doesn't exist. The fallback page (which we initialize ErrorPages with) is the same as last time, and will be called for any errors other than a 404 Not Found .

