It's time to create the first page for this app! But first, we need to make sure that import in src/lib.rs of mod templates; works, which requires us to create a new file src/templates/mod.rs, which declares src/templates as a module with its own code. Add the following to that file: pub mod about;
pub mod index; It's common practice to have a file for each template , which is slightly different to a page (explained in more detail later), and this app has two pages: a landing page (index) and an about page. Let's begin with the landing page. Create a new file src/templates/index.rs and put the following inside: use perseus::{GenericNode, StringResultWithCause, Template};
use serde::{Deserialize, Serialize};
use std::rc::Rc;
use sycamore::prelude::{component, template, Template as SycamoreTemplate}; #[derive(Serialize, Deserialize, Debug)]
pub struct IndexPageProps { pub greeting: String,
} #[component(IndexPage<G>)]
pub fn index_page(props: IndexPageProps) -> SycamoreTemplate<G> { template! { p {(props.greeting)} a(href = "/about") { "About!" } }
} pub fn get_template<G: GenericNode>() -> Template<G> { Template::new("index") .build_state_fn(Rc::new(get_build_props)) .template(template_fn()) .head(head_fn())
} pub async fn get_build_props(_path: String) -> StringResultWithCause<String> { Ok(serde_json::to_string(&IndexPageProps { greeting: "Hello World!".to_string(), }) .unwrap())
} pub fn template_fn<G: GenericNode>() -> perseus::template::TemplateFn<G> { Rc::new(|props: Option<String>| { template! { IndexPage( serde_json::from_str::<IndexPageProps>(&props.unwrap()).unwrap() ) } })
} pub fn head_fn() -> perseus::template::HeadFn { Rc::new(|_| { template! { title { "Index Page | Perseus Example – Basic" } } })
} This code is much more complex than the Hello World! example, so let's go through it carefully. First, we import a whole ton of stuff: perseus StringResultWithCause -- see below for an explanation of this Template -- as before GenericNode -- as before serde Serialize -- a trait for structs that can be turned into a string (like JSON) Deserialize -- a trait for structs that can be de serialized from a string (like JSON) std::rc::Rc -- same as before, you can read more about Rcs here sycamore component -- a macro that turns a function into a Sycamore component template -- the template! macro, same as before Template as SycamoreTemplate -- the output of the template! macro, aliased as SycamoreTemplate so it doesn't conflict with perseus::Template, which is very different Then we define a number of different functions and a struct, each of which gets a section now.

