Rust is an extremely powerful programming language, but I'll leave the introduction of it to its developers . WebAssembly (abbreviated Wasm) is like a low-level programming language for your browser. This is revolutionary, because it allows websites and web apps to built in programming languages other than JavaScript. Also, it's really fast (usually >30% faster than JS). But developing directly for the web with Rust using something like web-sys isn't a great experience, it's generally agreed in the web development community that developer experience and productivity is vastly improved by having a reactive framework. Let's approach this from a traditional JavaScript and HTML perspective first. Imagine you want to create a simple counter. Here's how you might do it in a non-reactive framework (again, JS and HTML here, no Rust yet): <p id="counter">0</p><br/>
<button onclick="document.getElementById('counter').innerHTML = parseInt(document.getElementById('counter').innerHTML) + 1">Increment</button> If you're unfamiliar with HTML and JS, don't worry. All this does is create a paragraph with a number inside and then increment it. But the problem is clear in terms of expression: why can't we just put a variable in the paragraph and have that re-render when we increment that variable? Well, that's reactivity! In JS, there are frameworks like Svelte and ReactJS that solve this problem, but they're all bound significantly by the language itself. JavaScript is slow, dynamically typed, and a bit of a mess . Like all things to do with the web, changing things is really difficult because people have already started using them, and there will always be someone still using Internet Explorer, which supports almost no modern web standards at all. Wasm solves all these problems by creating a unified format that other programming languages, like Rust, can compile into for the browser environment. This makes websites safer, faster, and development more productive. The equivalent of these reactive frameworks for Rust in particular would be projects like Sycamore , Seed , and Yew . Sycamore is the most extensible and low-level of those options, and it's more performant because it doesn't use a virtual DOM (link about JS rather than Rust), and so it was chosen to be the backbone of Perseus. Here's what that counter might look like in Sycamore (the incrementation has been moved into a new closure for convenience): use sycamore::prelude::*; let counter = Signal::new(0);
let increment = cloned!((counter) => move |_| counter.set(*counter.get() + 1)); template! { p {(props.greeting)} a(href = "/about") { "About!" } p { (counter.get()) } button(on:click = increment) { "Increment" }
} You can learn more about Sycamore's amazing systems here .

