Okay! We're past the hump, and now it's time to define the (much simpler) /about page. Create src/templates/about.rs and put the following inside: use perseus::Template;
use std::rc::Rc;
use sycamore::prelude::{component, template, GenericNode, Template as SycamoreTemplate}; #[component(AboutPage<G>)]
pub fn about_page() -> SycamoreTemplate<G> { template! { p { "About." } }
} pub fn get_template<G: GenericNode>() -> Template<G> { Template::new("about") .template(template_fn()) .head(head_fn())
} pub fn template_fn<G: GenericNode>() -> perseus::template::TemplateFn<G> { Rc::new(|_| { template! { AboutPage() } })
} pub fn head_fn() -> perseus::template::HeadFn { Rc::new(|_| { template! { title { "About Page | Perseus Example – Basic" } } })
} This is basically exactly the same as index.rs, except we don't have any properties to deal with, and we don't need to generate anything special at build time (but Perseus will still render this page to static HTML, ready to be served to your users).

